import React, { Component } from 'react'

import axios from 'axios';

import {Container,Row,Col, Card, Button  } from 'react-bootstrap';

//global_variable for RESTAPI-url
const url = `http://localhost:3003/user` //array 

con

export default class ReactBootstrap extends Component {
    
           
    constructor(props)
    {
        super(props)

        this.state = {

            photos: []

        }
    }


    
    render() 
    {



        return (
            <div className="container text-center">

                <h2>REACTBOOTSTRAP UI PACKAGE</h2>

                <Container>

                     <Row>
                       
                     <Col lg={4} md={4} sm={6} xs={12}>
                     
                     </Col>

                    </Row>

                </Container>



            </div>
        )
    }

    componentDidMount()
    {
        axios.get(url).then( (result)=> this.setState({ photos:result.data }) );
    }
    

}
